import React, { Component } from "react";

class Account extends Component {
  render() {
    return (
      <div className="view">
        <h1>Account</h1>
        <div className="content">
          <div className="content--inner">
            Here will be the forum
            
          </div>
        </div>
      </div>
    );
  }
}

export default Account;
